import React from "react";

const Popup = (props) => {
    return (
        <div className="popup">
            <img className="image-github" alt="Github profile image" />
            <div>
                <h1 className="name-github">Nome: Emanuel dos Santos Paz</h1>
                <p>devSantos16</p>
            </div>

            <p>Software Developer</p>
        </div>
    );
}
export default Popup;
